window.bookSummaryJSON = "<p>This 12th entry from Alexander McCall Smith’s <i>New York Times</i> best-selling series showcases the humanity and matchless wit that define Precious Ramotswe. While both Precious and Grace Makutsi are puzzled by prophetic dreams, life goes on at the No. 1 Ladies’ Detective Agency. Precious finds herself investigating a case of rural jealousy, while Grace inches closer to her wedding.</p>"; 
